window.bookSummaryJSON = "<p>“The answer to your question will be revealed on the Lunar Eclipse. But when discovering the truth, do not let the shadows take you.”</p> <p>Hell Week has begun.</p> <p>Senior students have been tasked with making the freshmen's lives pure torture as we prepare to face The Reckoning—the assessment that will decide whether we stay at Zodiac Academy or lose our places here forever.</p> <p>With the Lunar Eclipse on the horizon, my sister and I have more to worry about than just passing our exams.</p> <p>A dark plot is unfolding and the shadows are drawing closer. It looks like our enemies could be more powerful than we ever realised.</p> <p>Damn, who would have thought being a princess would be this hard?</p> <p>Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!</p> <p>Performed by Khaya Fraites, Jessica Schly, Gregory Linington, Julian Dailey, Jon Vertullo, Ryan Dalusung, Gabriel Michael, Nora Achrati, Shravan Amin, Kelly Baskin, Matthew Bassett, Lise Bruneau, Michael John Casey, Colleen Delany, Kaylee Eluvian, Karenna Foley, Amanda Forstrom, Bradly Foster Smith, Michael Glenn, Laura C. Harris, Tyler Hyrchuk, Ken Jackson, James Konicek, Drew Kopas, Lydia Kraniotis, Crystal Lee, Daniel Llaca, Jeri J. Marshall, Scott McCormick, Eric Messner, Robb Moreira, Stephanie Nemeth-Parker, Karen Novack, Richard Rohan, Joey Sourlis, Kit Swann, Yasmin Tuazon, Dawn Ursula and Christopher Walker.</p>"; 
